INSERT INTO PUBLIC.ALLOWEDVALUE (ALLOWEDVALUEID, NAME, VALUE, ELEMENTID, POPULATIONID, CREATEDDATE, CREATEDBY, UPDATEDATE, UPDATEBY, DESCRIPTION, SORTORDER, FEDERALVALUE) VALUES (23, 'declined', 'declined', 13, null, null, null, null, null, 'A youth is of Hispanic or Latino ethnicity if the youth is a person of Cuban, Mexican, Puerto Rican, South or Central American, or other Spanish culture or origin, regardless of race.  "Unknown" means the youth and/or parent is unable to communicate the youths ethnicity.  "Declined" means the youth or parent has declined to identify the youth''s Hispanic or Latino ethnicity.', 4, 'Declined');
