INSERT INTO PUBLIC.ALLOWEDVALUE (ALLOWEDVALUEID, NAME, VALUE, ELEMENTID, POPULATIONID, CREATEDDATE, CREATEDBY, UPDATEDATE, UPDATEBY, DESCRIPTION, SORTORDER, FEDERALVALUE) VALUES (57, 'yes', 'yes', 21, null, null, null, null, null, 'Academic supports are services designed to help a youth complete high school or obtain a General Equivalency Degree (GED).  Such services include the following: academic counseling; preparation for a GED, including assistance in applying for or studying for a GED exam; tutoring; help with homework; study skills training; literacy training; and help accessing educational resources.  Academic support does not include a youths general attendance in high school.', 1, 'Yes');
