INSERT INTO PUBLIC.ALLOWEDVALUE (ALLOWEDVALUEID, NAME, VALUE, ELEMENTID, POPULATIONID, CREATEDDATE, CREATEDBY, UPDATEDATE, UPDATEBY, DESCRIPTION, SORTORDER, FEDERALVALUE) VALUES (62, 'no', 'no', 23, null, null, null, null, null, 'Career preparation services focus on developing a youths ability to find, apply for, and retain appropriate employment. Career preparation includes the following types of instruction and support services: Vocational and career assessment, including career exploration and planning, guidance in setting and assessing vocational and career interests and skills, and help in matching interests and abilities with vocational goals; job seeking and job placement support, including identifying potential employers, writing resumes, completing job applications, developing interview skills, job shadowing, receiving job referrals, using career resource libraries, understanding employee benefits coverage, and securing work permits; retention support, including job coaching; learning how to work with employers and other employees; understanding workplace values such as timeliness and appearance; and understanding authority and customer relationships.', 2, 'No');
